   -webkit-text-stroke-color: white;
  }
  to {
    color: white;
    -webkit-text-stroke-width: 0px;
    -webkit-text-stroke-color: rgb(0, 0, 0);
  }
}

@keyframes circleGoCenter {
  from{
    top: -150px;
  }
  to {
    top: 200px;
  }
}

@keyframes enterLeft {
  from{
    opacity: 0.5;
    transform: translateX(-100vw)
  }
  to {
    opacity: 1;
    transform: translateX(0vw)
  }
}

@keyframes enterRight  {
  from{
    opacity: 0.5;
    transform: translateX(-100vw)
  }
  to {
    opacity: 1;
    transform: translateX(0vw)
  }
}



@keyframes write {
  to{
    stroke-dashoffset: 0;
  }
}

